import { SAVE_FAMILY_DATA_TO_STORE } from "../action/actionTypes";
import { INITIAL_STATE } from "../initialState";

export default (state = INITIAL_STATE.familyForm, action) => {
  // console.log("inside", state, action.payload);
  switch (action.type) {
    case SAVE_FAMILY_DATA_TO_STORE: {
      return {
        ...state,
        basicDetail: {
          familyId: action.payload.data[0].FamilyId,
        },

      };
    }
    default:
      return state;
  }
};
